  ?person a ns:people.person .
  ?person p:P31 ns:owlThing <http://dbpedia.org/ontology/OfficeHolder> .
  ?person rdfs:label ?name .
  ?name "Romano Antonio Prodi" .
}

SELECT ?person WHERE {
  ?person a ns:people.person .
  ?person ns:birthPlace ?birthPlace .
  ?birthPlace a ns:place.country .
  FILTER (xsd:date(?election) = "1962-11-02") 
}

SELECT ?child WHERE {
  ?parent a dbpedia-owl:Person ;
    rdfs:label "Archduke Ladislaus Philipp of Austria" .
  ?child a dbpedia-owl:ChildOf ?parent;
    rdfs:label ?childLabel .
  FILTER (?childLabel LIKE "%royalty%")
}
